VALUES ('Functional ambulation recovery in MCA stroke survivors: Predictive role of cognitive function and extremely low alanine aminotransferase levels: A retrospective observational study', 'Stroke is a leading cause of disability, significantly impacting mobility. Effective rehabilitation depends on accurate predictors of recovery. Recent studies suggest that both cognitive function and certain initial laboratory biomarkers, such as alanine aminotransferase (ALT), could be crucial for predicting recovery outcomes. This study investigates how cognitive function and ALT levels can predict functional ambulation in survivors of middle cerebral artery stroke. A retrospective analysis was conducted on 87 patients who began rehabilitation within 30 days of their first middle cerebral artery stroke. Multivariate logistic regression was employed to identify predictors of ambulation recovery. The variables assessed included age, sex, National Institutes of Health Stroke Scale, Berg Balance Scale, Mini-Mental State Examination, and extremely low ALT levels. Multivariate binary logistic regression revealed that female sex, lower Mini-Mental State Examination and Berg Balance Scale scores, and extremely low ALT levels were associated with poorer odds of achieving functional ambulation. This research underscores the critical role of integrating cognitive assessments and routine biomarkers into rehabilitation practices to enhance prognostic accuracy and personalize rehabilitation strategies. The findings highlight the need for further investigation to confirm these results and explore the underlying mechanisms, with the aim of advancing individualized rehabilitation approaches and improving patient outcomes. Stroke has a high prevalence worldwide and is a major health issue, with millions of people suffering from disabilities each year. Previous studies have highlighted several factors associated with functional mobility in stroke patients, including stroke type, age, sex, initial stroke severity as measured by the National Institutes of Health Stroke Scale (NIHSS), cognitive function, and motor function of the lower extremities. Cognitive function has a significant impact on the rehabilitation and functional recovery of stroke patients. Another factor that may have a significant impact on functional recovery after stroke is frailty. If frailty can be detected early through routine testing, it would be beneficial to have a precise, individualized rehabilitation plan. There is a substantial body of research that suggests that extremely low ALT levels found on routine testing are associated with frailty and sarcopenia, and even mortality in the elderly following physical stress. Middle cerebral artery (MCA) strokes, which affect specific brain regions, frequently result in substantial impairment of hand function due to the localization of the lesion. Despite this potential for ambulation recovery, a significant number of patients still fail to achieve functional ambulation within the short-term rehabilitation period. This can be attributed to various factors, including the severity of the initial stroke, the presence of cognitive impairments, and other underlying health conditions. The necessity for extended rehabilitation highlights the importance of identifying precise predictors of ambulation recovery to tailor rehabilitation programs more effectively and enhance patient outcomes. The objective of this study is to enhance the precision of prognostic assessments for functional ambulation recovery in MCA stroke survivors by evaluating the predictive value of cognitive function and extremely low levels of ALT. By integrating these indicators, the research aims to provide actionable insights that can guide personalized rehabilitation strategies and improve recovery outcomes, addressing a critical gap in current stroke rehabilitation practices. This retrospective medical record review study was approved by the Institutional Review Board of a university-affiliated hospital. Given its retrospective nature, the need for written informed consent was waived. This research was conducted using a retrospective analysis of electronically documented medical records, employing data derived from routine clinical evaluations and assessments performed during standard care protocols. The Functional Ambulation Classification (FAC) tool was utilized as the primary criterion for assessing ambulation, ensuring consistent evaluation across different studies and enhancing the comparability and reliability of results. Balance, encompassing both fundamental lower limb motor functions and proprioceptive aspects, was identified as a critical body function for functional ambulation. Thus, the Berg Balance Scale (BBS) was chosen as a key predictor due to its comprehensive assessment of balance, which is essential for evaluating functional ambulation outcomes. Cognitive function, which has been widely studied for its influence on post-stroke recovery of walking ability, was assessed using the Mini-Mental State Examination (MMSE). Regarding the inclusion of laboratory findings, routine blood tests conducted during the acute phase of stroke were retrospectively collected and analyzed for their prognostic significance. This approach focused on blood test results from the time of stroke onset to identify biomarkers that could influence clinical outcomes and prognosis. Creatinine was included due to its well-documented association with functional outcomes post-stroke, serving as a covariate to adjust for its prognostic influence. This retrospective chart review study was performed in line with the principles of the Declaration of Helsinki. Approval was granted by the Institutional Review Board of the Catholic Kwandong University International St Maryâ€™s Hospital (Institutional Review Board No. IS24RISI0006, 2024). Given its retrospective nature and use of de-identified medical records, the requirement for written informed consent was waived. A retrospective medical record review study conducted at a university-affiliated hospital from June 2016 to June 2023. Patients who were diagnosed with a first stroke (ischemic or hemorrhagic), transferred to a rehabilitation department, and started rehabilitation within 30 days of their first stroke were defined as initial subacute stroke patients and were included in the study. This study focused only on subjects with hemiplegic MCA stroke who were not initially able to ambulate. Patients were excluded from the study if they (1) had musculoskeletal disorders that could influence their gait;

