VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'orldwide and is a major health issue, with millions of people suffering from disabilities each year. Previous studies have highlighted several factors associated with functional mobility in stroke patients, including stroke type, age, sex, initial stroke severity as measured by the National Institutes of Health Stroke Scale (NIHSS), cognitive function, and motor function of the lower extremities. Cognitive function has a significant impact on the rehabilitation and functional recovery of stroke patients. Another factor that may have a significant impact on functional recovery after stroke is frailty. If frailty can be detected early through routine testing, it would be beneficial to have a precise, individualized rehabilitation plan. There is a substantial body of research that suggests that extremely low ALT levels found on routine testing are associated with frailty and sarcopenia, and even mortality in the elderly following physical stress.', '{-0.17919032275676727,0.0396430678665638,1.1121543645858765,-0.33218908309936523,-0.023907208815217018,0.19090622663497925,0.09244056791067123,0.051592275500297546,-1.1185370683670044,-0.33106058835983276,-0.18169263005256653,0.16326209902763367,-0.5953372120857239,-0.0041528623551130295,0.4688390791416168,-0.30770620703697205,0.3884391784667969,0.14845898747444153,0.048212386667728424,-0.07019815593957901,-0.811692476272583,-0.11767018586397171,0.25314265489578247,-0.18543115258216858,-0.1514045000076294,1.0337350368499756,0.15531809628009796,0.2661336362361908,0.9426254630088806,-0.034312959760427475,-0.4331182539463043,0.30473482608795166,-0.8078842759132385,-0.3596441149711609,-0.4122810661792755,0.2308388650417328,0.0031062401831150055,-0.47806620597839355,-0.438361793756485,-0.11249326914548874,0.20641383528709412,-0.3295246362686157,-0.37440603971481323,-1.2164256572723389,0.07721081376075745,-0.05509795621037483,-0.13481944799423218,-0.466941118