VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'associated with frailty and sarcopenia, and even mortality in the elderly following physical stress. Middle cerebral artery (MCA) strokes, which affect specific brain regions, frequently result in substantial impairment of hand function due to the localization of the lesion. Despite this potential for ambulation recovery, a significant number of patients still fail to achieve functional ambulation within the short-term rehabilitation period. This can be attributed to various factors, including the severity of the initial stroke, the presence of cognitive impairments, and other underlying health conditions. The necessity for extended rehabilitation highlights the importance of identifying precise predictors of ambulation recovery to tailor rehabilitation programs more effectively and enhance patient outcomes.', '{-0.3869574964046478,0.607754647731781,0.38168928027153015,-0.40331482887268066,0.2303490936756134,0.06179649382829666,0.30666491389274597,-0.23435962200164795,-0.5987786650657654,-0.10742061585187912,-0.30391666293144226,-0.0763465091586113,-0.6717405915260315,-0.10639351606369019,0.6530441641807556,-0.11991618573665619,0.09617839008569717,-0.030377665534615517,-0.5803986191749573,-0.17976760864257812,-0.7143394947052002,-0.14389489591121674,0.8399655818939209,-0.22372089326381683,-0.5024550557136536,0.735155463218689,-0.27010804414749146,0.7265129685401917,0.8489431142807007,0.44869139790534973,-0.11000660061836243,0.46781617403030396,-0.7540966868400574,-1.0429484844207764,-0.5839709639549255,0.11880173534154892,-0.20824095606803894,-0.38718751072883606,0.5620107054710388,-0.011508811265230179,-0.06836599856615067,0.5042771100997925,-0.3980911076068878,-1.2837163209915161,0.22916558384895325,-0.7104988098144531,-0.25383827090263367,-0.1514018326997757,-0.5630965828895569,0.269586980342865,-0.08828769624233246,-0.26947784423828125,0.2330864667892456,0.2813394367694855,0.1618994474411010