VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 14, 'ity Index, MMSEâ€…=â€…Mini-Mental State Examination, NIHSSâ€…=â€…National Institutes of Health Stroke Scale. In summary, this study investigated factors affecting functional ambulation after subacute rehabilitation in stroke patients. The key findings indicate that sex, age, initial MMSE, serum hemoglobin, albumin, extremely low-level serum ALT, CCI, and initial BBS were significantly associated with functional ambulation outcomes. Multivariate analysis revealed that being male, younger, having higher serum hemoglobin, higher MMSE, and higher initial BBS scores predicted better ambulation outcomes. Additionally, patients with extremely low-level serum ALT were less likely to achieve functional ambulation compared to those with ALT levels within the normal reference range. This study aimed to elucidate the determinants of functional ambulation in stroke patients undergoing subacute rehabilitation, addressing a critical gap in understanding recovery trajectories.', '{0.043285369873046875,0.4809323251247406,0.37918543815612793,-0.41431090235710144,0.08757172524929047,0.06206455081701279,0.31339821219444275,-0.22136729955673218,-0.46665510535240173,-0.3194752335548401,-0.03124259039759636,-0.21105901896953583,-0.7287272810935974,0.012583805248141289,1.1724064350128174,-0.32050567865371704,0.11655370891094208,-0.5635886192321777,-0.5607762336730957,0.09431809186935425,-0.963211715221405,-0.024660242721438408,0.4668760299682617,-0.15024933218955994,-0.4022386074066162,0.4922600984573364,0.08287018537521362,0.41503578424453735,0.9187414646148682,0.07207334786653519,0.09029924869537354,0.5159032940864563,-0.887241542339325,-0.7626090049743652,-0.309071809053421,0.174331396818161,0.06490153819322586,-1.2851518392562866,0.269336462020874,0.4435045123100281,0.13352008163928986,0.1642431765794754,-0.2277257740497589,-1.531586766242981,0.5859582424163818,-0.6041833162307739,-0.2150811105966568,-0.3447627723