VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'aware of risk factors. Prevention and treatment test Type 1 diabetes cannot currently be prevented. Effective approaches are available to prevent type 2 diabetes and to prevent the complications and premature death that can result from all types of diabetes. These include policies and practices across whole populations and within specific settings (school, home, workplace) that contribute to good health for everyone, regardless of whether they have diabetes, such as exercising regularly, eating healthily, avoiding smoking, and controlling blood pressure and lipids.Â The starting point for living well with diabetes is an early diagnosis â€“ the longer a person lives with undiagnosed and untreated diabetes, the worse their health outcomes are likely to be. Easy access to basic diagnostics, such as blood glucose testing, should therefore be available in primary health care settings. Patients will need periodic specialist assessment or treatment for complications.', '{0.042317945510149,-0.4361802935600281,0.04949522763490677,0.2807813584804535,0.20794659852981567,0.4193342328071594,0.5281994342803955,0.45758140087127686,0.5146676301956177,0.11209704726934433,0.2568471431732178,0.7197632193565369,-0.6116068959236145,-1.187142014503479,-0.4186585247516632,0.025308173149824142,0.6406110525131226,0.5950402021408081,-0.18336476385593414,-0.09757914394140244,-0.04218947887420654,-0.4703785479068756,-0.3170381486415863,-0.4681638777256012,-0.2955654561519623,0.08272586017847061,-0.2891029119491577,-0.5200186967849731,0.27655649185180664,-0.11333978176116943,-0.3517282009124756,0.023598771542310715,0.5577512979507446,0.37585732340812683,-0.8105812668800354,-0.18084047734737396,-0.33114567399024963,0.8044503331184387,0.3900700807571411,-0.38090330362319946,-0.15104511380195618,0.4789680242538452,0.22468622028827667,-0.05168193206191063,-0.2427869588136673,0.19331276416778564,0.6911230683326721,0.299889147281