VALUES ('WHO Health Topic: Cardiovascular Diseases', 'Overview Cardiovascular diseases (CVDs) areÂ the leading cause of death globally, taking an estimatedÂ 17.9 million lives each year. CVDs are a group ofÂ disorders of the heart and blood vessels and include coronary heart disease, cerebrovascular disease, rheumatic heart disease and other conditions. More than four out of five CVD deaths are due to heart attacks and strokes, and one third of these deaths occur prematurely in people under 70 yearsÂ of age.The most important behavioural risk factors of heart disease and stroke are unhealthy diet, physical inactivity, tobacco use and harmful use of alcohol. Amongst environmental risk factors, air pollution is an important factor. The effects of behavioural risk factors may show up in individuals as raised blood pressure, raised blood glucose, raised blood lipids, and overweight and obesity. These â€œintermediate risks factorsâ€ can be measured in primary care facilities and indicate an increased risk of heart attack, stroke, heart failure and other complications.Cessation of tobacco use, reduction of salt in the diet, eating more fruit and vegetables, regular physical activity and avoiding harmful use of alcohol have been shown to reduce the risk of cardiovascular disease. Health policies that create conducive environments for making healthy choices affordable and available, as well as improving air quality and reducing pollution, are essential for motivating people to adopt and sustain healthy behaviours.Identifying those at highest risk of CVDs and ensuring they receive appropriate treatment can prevent premature deaths. Access to noncommunicable diseaseÂ medicines and basic health technologies in all primary health care facilities is essential to ensure that those in need receive treatment and counselling. Symptoms Heart attack and strokeOften, there are no symptoms of the underlying disease of the blood vessels. A heart attack or stroke may be the first sign of underlying disease. Symptoms of a heart attack include:pain or discomfort in the centre of the chest;

