VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 's physical, emotional and financial strain on individuals, families, communities and health systems. Many health systems in low- and middle-income countries are least prepared to manage this burden, and large numbers of cancer patients globally do not have access to timely quality diagnosis and treatment. In countries where health systems are strong, survival rates of many types of cancers are improving thanks to accessible early detection, quality treatment and survivorship care. Prevention Between 30% and 50% of cancer deaths could be prevented by modifying or avoiding key risk factors and implementing existing evidence-based prevention strategies. The cancer burden can also be reduced through early detection of cancer and management of patients who develop cancer. Prevention also offers the most cost-effective long-term strategy for the control of cancer.', '{-0.03407767787575722,-0.26863089203834534,0.3344562351703644,0.03043912537395954,0.5475762486457825,0.5556750297546387,0.11479093134403229,-0.17961838841438293,-0.10963159799575806,0.05521243438124657,-0.21897763013839722,0.7254834771156311,-0.4560297429561615,-0.9501898884773254,0.01358537282794714,-0.16127996146678925,1.0819814205169678,0.08854788541793823,0.32561638951301575,0.10404174029827118,-0.1413724571466446,0.128944993019104,-0.6103305816650391,-0.15111586451530457,-0.519926905632019,0.12111460417509079,-0.9042488932609558,-0.47235020995140076,-0.17514392733573914,-0.09664864093065262,-0.4833850860595703,-0.10279359668493271,0.6097127795219421,0.10441404581069946,-0.831649124622345,0.3925539255142212,0.05732579156756401,0.6685333847999573,-0.9000328183174133,-0.010065657086670399,0.06393349915742874,-0.06061688810586929,-0.14209704101085663,-0.9549707174301147,-0.3410184383392334,-0.6133612394332886,0.7570794224739075,-0.6245134472846985,0.6501975655555725,0.15426771342754364,0.08966176211833954,0.1979919821023941,0.04178725928