VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'le in low- and middle-income countries are more likely to develop cancer through chronic infections. Management Cancer is more likely to respond to effective treatment when identified early, resulting in a greater probability of surviving as well as less morbidity and less expensive treatment. There are two distinct strategies that promote early detection:Early diagnosis identifies symptomatic cancer cases at the earliest possible stage. Screening aims to identify individuals with abnormalities suggestive of a specific cancer or pre-cancer who have not developed any symptoms and refer them promptly for diagnosis and treatment .Treatment options include surgery, cancer medicines and/or radiotherapy, administered alone or in combination. A multidisciplinary team of cancer professionals recommends the best possible treatment plan based on tumour type, cancer stage, clinical and other factors.', '{-0.3678491413593292,-0.4088810086250305,0.3084760010242462,-0.31543758511543274,0.09745605289936066,0.4834413230419159,-0.28953906893730164,-0.19550451636314392,-0.2881825268268585,0.461989164352417,-0.5380957126617432,0.922400712966919,-0.21224692463874817,-0.8960660696029663,-0.22368451952934265,-0.15722140669822693,0.04597614333033562,-0.05444050952792168,0.19071172177791595,-0.21746504306793213,-0.18729665875434875,-0.10577758401632309,-0.42439913749694824,-0.18362411856651306,-0.6943339705467224,0.1266893446445465,-0.5260278582572937,-0.09174781292676926,-0.06683270633220673,-0.1941099762916565,-0.8438676595687866,-0.4007684290409088,0.5408945679664612,-0.1612396240234375,-0.7189629077911377,0.14863693714141846,0.4305230379104614,0.5229998230934143,-0.985196590423584,-0.1665232926607132,0.10968485474586487,0.07717669010162354,-0.7506400346755981,-0.7988845705986023,-0.027077117934823036,0.11196421086788177,0.38636043667793274,-0.46874865889549255,0.7527031898498535,0.04031507670879364,-0.0185129754245