VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'uate vitamins or minerals, overweight, obesity, and resulting diet-related noncommunicable diseases.The developmental, economic, social, and medical impacts of the global burden of malnutrition are serious and lasting for individuals and their families, for communities and for countries.Learn about Nutrition and Food Safety and COVID-19 Impact Most recent estimates show that globally, 149.2 million children under the age of 5 years of age are stunted (too short for their age) and 45.4 million are wasted (underweight for their height).Â  The number of children with stunting is declining in all regions except Africa. Over three-quarters of all children suffering from severe wasting live in Asia.Around 45% of deaths among children under 5 years of age are linked to undernutrition. These mostly occur in low- and middle-income countries. Anaemia is a serious global public health problem that particularly affects young children and pregnant women.', '{0.2994016408920288,-0.9042179584503174,0.24295583367347717,0.002208653837442398,0.17171993851661682,0.8871506452560425,-0.011508051306009293,-0.008559484966099262,-0.2664639353752136,-0.3320310413837433,0.32567521929740906,0.33145543932914734,-0.6881088614463806,0.5881446599960327,-0.10362701117992401,0.21039098501205444,0.3075804114341736,0.7496157884597778,-0.09899009764194489,-0.028242258355021477,-0.8595274090766907,0.25928327441215515,-0.8169331550598145,-0.04955478757619858,0.4057152569293976,-0.16193874180316925,-0.6352680325508118,-0.6614004969596863,0.5629733800888062,0.28939494490623474,-0.3496547341346741,0.20186470448970795,0.21284469962120056,0.03308223560452461,-0.3187636137008667,-0.4769803285598755,0.48721393942832947,-0.016766240820288658,-0.38003888726234436,0.5814619660377502,-0.7173799276351929,0.078619085252285,0.030567793175578117,0.21978968381881714,0.11677299439907074,0.19839546084403992,0.4345298409461975,0.21005406975746155,0.02